 ) at follicle selection . Marmosets were given an injection of

</mark>
 on Day 5 of the follicular phase and ovaries were evaluated on Day 10 or 15 . Ovaries from controls were assessed on Day 5 ( time of selection ) , Day 10 ( peri-ovulatory ) and Day 15 ( luteal phase ) . At Day 10 , ovaries of four of the five controls contained dominant follicles , while one had ovulated . 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 - treated ovaries also contained large follicles on Day 10 , but

<div class="entities" style="line-height: 2.5; direction: ltr">Gender influences the class III and V β-tubulin ability to predict poor outcome in colorectal cancer . PURPOSE : Colorectal cancer is one of the deadliest diseases in Western countries . To predict the outcome of therapy , we assessed the role of class III ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    Q13509
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ) and class V β-tubulin ( Q9BUF5 ) as predictive biomarkers . EXPERIMENTAL DESIGN : Using immunohistochemistry and nanofluidics , the expression of 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    Q13509
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 and Q9BUF5 was assessed in two cohorts of 180 and 134 patients , respectively . The 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P05093
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 RS743572 was genotyped to identify GG carriers with enhanced androgen levels . 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    Q13509
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 and Q9BUF5 were investigated in 22 colorectal cancer cell lines in basal conditions and after serum starvation , the latter serving as activator of this prosurvival pathway . To ascertain the role of androgen receptor ( AR ) in such regulation , we silenced AR and checked 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    Q13509
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 and Q9BUF5 expression and sensitivity to chemotherapy . RESULTS : There was a link between poor survival , the expression of 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    Q13509
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 / Q9BUF5 , and AR only in females . Conversely , only in males carriers of the GG phenotype exhibited the worst outcome . Importantly , male cell lines were resistant to serum starvation and exhibited higher levels of Q9BUF5 , thereby suggesting that the pathway is activated by androgens . In female cells this phenomenon was absent . In both genders , AR was the main driver of 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    Q13509
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 / Q9BUF5 expression , as constitutive silencing of AR was associated with downregulation of

<div class="entities" style="line-height: 2.5; direction: ltr">Paullones are potent inhibitors of glycogen synthase kinase - 3beta and cyclin-dependent kinase 5 / p25 . Paullones constitute a new family of benzazepinones with promising antitumoral properties . They were recently described as potent , DB00171 - competitive , inhibitors of the cell cycle regulating cyclin-dependent kinases ( CDKs ) . We here report that paullones also act as very potent inhibitors of glycogen synthase kinase - 3beta ( GSK - 3beta ) ( IC50 : 4-80 nM ) and the neuronal 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 / p25 ( IC50 : 20-200 nM ) . These two enzymes are responsible for most of the hyperphosphorylation of the microtubule-binding protein tau , a feature observed in the brains of patients with Alzheimer ' s disease and other neurodegenerative ' taupathies ' .

 , the most active paullone , was demonstrated to act by competing with DB00171 for binding to GSK - 3beta .

 specific inhibitor valdecoxib in the management of osteoarthritis of the hip : a randomized , double-blind , placebo-controlled comparison with naproxen . OBJECTIVE : Non-steroidal antiinflammatory agents are commonly used to treat pain and inflammation associated with osteoarthritis ( OA ) , but have poor gastrointestinal ( GI ) tolerability . This study compared the efficacy of the

 specific inhibitor valdecoxib with naproxen and placebo , in treating symptomatic OA of the hip . DESIGN : This multicenter , randomized , double-blind 12 - week study compared the efficacy and tolerability of single daily doses of valdecoxib 5 mg and 10 mg with placebo or naproxen 500 mg 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P55957

 . Efficacy was assessed by Patient ' s and Physician ' s Global Assessment of Arthritis , and the WOMAC ( Western Ontario and McMasters ) OA Individual and Composite Indices . The incidence of adverse events was monitored throughout the study . RESULTS :

 was clinically and statistically superior to placebo for Patient ' s and Physician ' s Global Assessment of Arthritis and for all WOMAC OA Indices over the 12 week study period ( P &lt; or = 0.05 ) .

 10 mg was similar to naproxen in terms of efficacy , and demonstrated greater numerical improvements compared with valdecoxib 5 mg .

 5 mg and 10 mg demonstrated similar tolerability compared to placebo and a lower incidence of GI-related adverse effects compared with naproxen . CONCLUSIONS : Single daily doses of valdecoxib 5 mg and 10 mg were similar to naproxen and superior to placebo , in treating symptomatic OA of the hip . Both doses of valdecoxib were well tolerated and demonstrated improved GI tolerability compared to naproxen .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">Comparison of the effects of cytoprotective drugs on human plasma adrenocorticotropic hormone and cortisol levels with continual stress exposure . Cetraxate hydrochloride ( cetraxate ) , ecabet sodium ( ecabet ) , and sulpiride , which are cytoprotective drugs , have been used to treat peptic ulcers and acute or chronic gastritis . They are reported to improve mucosal blood flow in the stomach . One of the most important factors believed to cause gastric ulcers is mental and / or physiological stress . When people feel stress , the hypothalamo-pituitary-adrenal (

<div class="entities" style="line-height: 2.5; direction: ltr">Drug insight : Use of docetaxel in prostate and urothelial cancers . Taxanes have emerged as a potent class of chemotherapeutic agents in many malignancies , with two taxanes now in clinical use . Their mechanism of action against tumor cells is by alteration of microtubule dynamics , which causes cell-cycle arrest during mitosis . 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB01248
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 binds to the microtubules with a higher affinity than paclitaxel , and over a broader range of cell-cycle activities . It has also been shown to promote apoptosis via 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 phosphorylation . In hormone-refractory prostate cancer , docetaxel has been studied as both a single agent and in combination with estramustine , and in different treatment schedules , with demonstrated efficacy . Two phase III trials have confirmed a survival benefit , making docetaxel the first chemotherapy agent with proven efficacy against prostate cancer . In urothelial cancer , docetaxel has demonstrated activity and has been investigated as a single agent and in combination regimens . A phase III trial comparing docetaxel and cisplatin to methotrexate , vinblastine , doxorubicin , and cisplatin was inferior when evaluating response rates and overall survival . More recent phase II trials combining docetaxel with two additional agents have shown promise , but confirmatory trials are needed .</div>
